import React from 'react';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import ReportTrackingPage from './components/ReportTrackingPage';

import ProfilePage from './components/ProfilePage';

import ContractorsPage from './components/ContractorsPage'; // <-- Import ContractorsPage



function App() {

  return (

    <Router>

      <div className="App">

        <Routes>

          <Route path="/" element={<ReportTrackingPage />} />

          <Route path="/profile" element={<ProfilePage />} />

          <Route path="/contractors" element={<ContractorsPage />} /> {/* Add this route */}

        </Routes>

      </div>

    </Router>

  );

}



export default App;
